  [14351]="NO!!!  It puts the tannin in the basket, or it gets the mallet again!",
  [14354]="Chase me if you dare! I run without a care!",
  [14368]="I personally didn't mind him. It was the Prince who took exception to a high elf in his domain. Alas, I am not one to question the Prince. In his defense, he did not incinerate Master Dreamseeker immediately.",
  [14392]="Bear witness to the undeniable power of your Warchief! Be lifted by the rallying cry of your dragon slayers!",
  [14394]="Behold the might of the Alliance! The dread lady, Onyxia, hangs from the arches! Let the rallying cry of the dragon slayer lift your spirits!",
