  [14737]="Don't fight in broken weapons and armor! Expert armor and weapon repairing done here - while you wait!",
  [14748]="Another fool falls for the trap!",
  [14757]="Finally, I am free! I come home soon, my dear!",
  [14822]="Come speak with me, and what once was cloudy shall become crystal clear.",
  [14823]="Come one, come all.  Welcome to the Darkmoon Faire!  Don't be shy.  Step right up to Lhara and buy yourself an exotic artifact from far off lands.  If you're one of the lucky few who have found Darkmoon Cards, have a word with Professor Paleo.  Hungry?  Thirsty?  You're in luck!  Refreshments are available right here from Sylannia and Stamp.  I recommend the Darkmoon Special Reserve to wash down some Red Hot Wings.  And if the future is what you seek, then run, don't walk, to speak with Sayge.",
  [14828]="Five tickets or two-hundred and fifty, it doesn't matter friend, everybody is a winner!",
  [14834]="Fleeing will do you no good, mortals!",
  [14844]="Cheap Beer!  Get your Cheap Beer right here!",
  [14845]="Darkmoon Dogs fresh off the grill.  Come and get em while they're hot!",
  [14846]="Come and take a look at my wares while you still can.  We're here all week, and then we're off to some far off land.",
  [14847]="Come speak with me if you are a purveyor of the unusual, or if you have any Darkmoon Faire Cards.",
  [14849]="Can't you see I've got work to do here?",
  [14875]="All Hail &lt;name&gt;, slayer of Hakkar, and hero of Azeroth!",
  [14910]="Do you know who I am, zealot?",
  [14912]="How pathetic. I am infused with the power of the Soulflayer. I fear nothing but the wrath of the almighty Hakkar. I serve no one but my master, Jin.",
  [15077]="And the Tastyfish have gone for the week!   I will remain for another hour to allow you to turn in your fish!",
  [15111]="Feel da big bad voodoo!",
  [15117]="I am released through you! Avenge me!",
  [15180]="When the time is right, my lady. All will be clear when the time is right. The master stirs even now. Look to the skies for the Brood of Nozdormu have returned.",
  [15183]="A mighty Qiraji known as General Rajaxx would command the initial incursion into Silithus. Only one would stand in his way: A night elf known as Staghelm. They refer to him as Khar'sis or 'hand of the earth' in the native Qiraji tongue.",
