  [16851]="You treat my hat well now, &lt;name&gt;.  You won't find a finer one anywhere in this world or another.",
  [16864]="Craziest thing - No matter how many bottles I take from the stockpile, the quantity on hand never decreases. It's like I'm stuck in some endless loop of actions...",
  [16886]="As long as he remains unfound, I will search. I know that he lives. And I know that I must find him. I am thankful for what you have done, Commander. As my father called upon you, a brother in arms, know that you may call upon me. I am at your service, my Lord.",
  [16907]="Death to the interlopers!",
