  [21740]="Yes... Well enough for the elements that are here, but the cipher is known to another... The spirits of fire are in turmoil... If this force is not stopped, the world where these mortals came from will cease.",
  [21743]="Guardians! To me!",
  [21751]="Ack, disintegrated!  I guess I had the power setting too high?  And it almost hit the Wheeler Mobile!  Yikes, don't tell him!",
